import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography
} from '@material-ui/core';

import Menu from './Menu';
import Content from './Content';

export default class App extends React.Component{
  render(){
    return(
      <div>
        <AppBar>
          <Toolbar>
            <Typography>Benefits Dashboard</Typography>
          </Toolbar>
        </AppBar>
        <nav>
          <Menu/>
        </nav>
        <div>
          <Content/>
        </div>
      </div>
    );
  };
};
